import React from 'react';
import AddSubmissionType from './components/AddSubmissionTypes';
import AdminNavBar from './components/NavBars/AdminNavBar';
import ViewUsers from './components/ViewUsers';


function App(){
    return (
        <div className='App'>
            <AdminNavBar/>
            <AddSubmissionType/>
            <ViewUsers/>
        </div>        
    )
}
export default App;
